import React from 'react'

const CareersComponent = props => {

    return (
        <div key={props.id} id={props.id} className="p-4 p-md-5">
            <a href="javascript:void(0)" class="text-dark text-large font-weight-semibold">Account Director</a>
            <div className="d-flex flex-wrap mt-3">
                <div className="mr-3">
                    <i className="vacancy-tooltip ion ion-md-business text-light" title="department"></i>&nbsp;
                    {/* {props.department} */}
                    Admin
                </div>
                <div className="mr-3">
                    <i className="vacancy-tooltip ion ion-md-time text-primary" title="Employment"></i>&nbsp; 
                    {/* {props.employment} */}
                    FullTime
                </div>
            </div>
                <div className="mt-3 mb-4">
                {/* {prop.description} */}
                asdasdasdasd
                </div>
                <button type="button" className="btn btn-primary btn-round">Learn More</button>

            <hr className="border-light m-0" />
        </div>
    )
}

export default CareersComponent
